import React from 'react';
import {Button, Navbar, Nav, NavDropdown, 
  Container, Col, Row, 
  Card} from 'react-bootstrap'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import logo from './logo.svg';
import './App.css';
//import '@fontawesome/fontawesome-free/css/all.css'

class Top extends React.Component{
  render(){
    return(
      <div>
        <Navbar bg="success" variant="light" expand="lg">
          <Navbar.Brand href="/"><Link to="/"><i class="fas fa-flask"></i> NW Labs</Link></Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link><Link to="/about">About</Link></Nav.Link>
              <Nav.Link><Link to="/contact">Contact</Link></Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
      </div>
    )
  }
}

class Left extends React.Component{
  render(){
    return(
      <div>
        <Link to="/">Home</Link>
        <br></br>
        <Link to="/about">About</Link>
        <br></br>
        <Link to="/contact">Contact</Link>
      </div>
    )
  }
}

class Right extends React.Component{
  render(){
    return(
      <div>

      </div>
    )
  }
}

class HomeHeader extends React.Component{
  render(){
    return(
      <header className="App-header">
        <div>
          <i className="fas fa-flask m-3 p-4" style={{
            fontSize: "10rem",
            color: "#blue"
          }}></i></div>
        <div>
          <h1>Northwest Labs</h1>

          <h3>Where all you chemical testing dreams come true!</h3>
        </div>
        <Button variant="success" size="lg" style={{margin: "2rem"}}>Get Started today!</Button>
      </header>
    )
  }
}
