  render(){
    return(
      <header className="App-header">
        <div>
          <i className="fas fa-flask m-3 p-4" style={{
            fontSize: "10rem",
            color: "#blue"
          }}></i></div>
        <div>
          <h1>Northwest Labs</h1>

          <h3>Where all you chemical testing dreams come true!</h3>
        </div>
        <Button variant="success" size="lg" style={{margin: "2rem"}}>Get Started today!</Button>
      </header>
    )
  }
}

class ContactHeader extends React.Component{
  render(){
    return(
      <div>
        <header className="App-header">
          <div>
            <i className="fas fa-flask m-3 p-4" style={{
              fontSize: "10rem",
              color: "#blue"
            }}></i></div>
          <div>
            <h1>Northwest Labs</h1>

            <h3>Where all you chemical testing dreams come true!</h3>
          </div>
          <Button variant="success" size="lg" style={{margin: "2rem"}}>Get Started today!</Button>
        </header>
      </div>
    )
  }
}

class ContactContent extends React.Component{
  render(){
    return (
      <div>
        <Container>
          <Row>
            <Col>
              <h1>Contact Page</h1>
              <p>This is some other content that we can put on here</p>
            </Col>
          </Row>
          <Row>
            <Col>
              <Card>
                <Card.Img variant="top" src="" />
                <Card.Body>
                  <Card.Title>Card Title</Card.Title>
                  <Card.Text>
                    Some quick example text to build on the card title and make up the bulk of
                    the card's content.
