          </Row>
        </Container>
      </div>
    )
  }
}

class Footer extends React.Component{
  render(){
    var today = new Date();

    return(
      <div>
          <h6> Â© {today.getFullYear()} Northwest Labs</h6>
      </div>
    )
  }
}

function Home() {
  return(
    <div>
      <HomeHeader/>
      <h1>Home Page</h1>
      <p>This is some other content that we can put on here</p>
    </div>
  )
}
function About() {
  return(
    <div>
      <AboutHeader/>
      <h1>About Page</h1>
      <p>This is some other content that we can put on here</p>
    </div>
  )
}
function Contact() {
  return(
    <div>
      <ContactHeader/>
      <ContactContent/>
    </div>
  )
}

function App() {
  return (
    <Router>
      <div className="App">
        {/*top component */}
        <Row>
          <Col>
            <Top />
          </Col>
        </Row>
        {/* left and right components and a switched main cneter content */}
        <Row>
          <Col xs={1}>
            <Left/>
          </Col>
          <Col>
            <Switch>
            <Route exact path="/">
              <Home/>
            </Route>
            <Route path="/about">
              <About/>
            </Route>
            <Route path="/contact">
              <Contact/>
            </Route>
          </Switch>
          </Col>
          <Col xs={1}>
            <Right/>
          </Col>
        </Row>
        {/*footer component */}
        <Row>
          <Footer/>
        </Row>
      </div>
    </Router>
  );
}

export default App;
